    }
  return (<div>


<Router>
  <div>
    <div class="sidenav">
      <nav style={{ margin: 10 }}>
      {Options.map((item) => {
          return (
            <NavLink
          to={item.url}
          className={item.class}
          name={item.name}
          onClick={handlerClick}
        >
          {item.name}
        </NavLink>

          );
        })}


      </nav>


      <Route path="/about"  exact component={About} />
    </div>
</div>
    </Router>


     </div>
     )




}
